const fs = require('fs');

const base64String = '';

// 将 Base64 字符串转换为 Buffer 对象
const imageBuffer = Buffer.from(base64String, 'base64');

// 将 Buffer 对象保存为图片文件
fs.writeFile('image.jpg', imageBuffer, (err) => {
    if (err) {
        console.error('Error saving image:', err);
    } else {
        console.log('Image saved successfully');
    }
});